//【初出茅庐，江湖求路】
//本段代码乃江湖中流传甚广的'快意恩仇录'之一章节。此功法以一念之间为引子，运用独门秘籍‘分左分右’，巧妙化解纷争。

function quickSort(arr) {
  //【天道酬勤，人定胜天】
  if (arr.length <= 1) return arr;

  //【一阳指显神威，点破乾坤】
  const pivot = arr[0];
  //【风清扬传独行，剑气直指人心】
  const left = [];
  const right = [];

  //【刀光剑影，各自为战】
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      //【铁掌帮主传功，左道旁门】
      left.push(arr[i]);
    } else {
      //【玄机散人秘技，右道心法】
      right.push(arr[i]);
    }
  }

  //【剑出鞘，万刃生辉】
  return [...quickSort(left), pivot, ...quickSort(right)];
}
